import React, { Component } from "react";
import { DEFAULT_BREAKPOINTS } from "react-bootstrap/esm/ThemeProvider";
import { Link } from "react-router-dom"
import { useParams } from 'react-router-dom';
import memberInfo from "./memberInfo";

function TeamMember ({match}) {
    const { id } = useParams();
    console.log(id);
    const member = memberInfo[id-1];
    return(
        <Link to={`/member/${member.id}`} className="col-md-4 col-sm-6">
            <div className="card">
                <div className="card-header">
                    <img style={{maxWidth: '100%'}} src={member.img}/>
                </div>
                <div className="card-body" 
                     style={{backgroundColor : member.website ? "white" : "black"}}>
                    <h2>{member.name}</h2>
                    <h5>{member.position}</h5>
                    <div>{member.phone}</div>
                    <div>{member.email}</div>
                    <div>{member.website}</div>
                </div>
            </div>
        </Link>
    )
}

export default TeamMember;

